import React from 'react';


function AboutUs(){
	return(
		<div>
			<h3>About us</h3>
			<p>Welcome to OnRent, your number one source for all things product to give or take on rent. We're dedicated to providing you the very best of product.


			Founded in Feb 2021 by Sumit Dhakad and Ajay Patel, OnRent has come a long way from its beginnings in Bhopal, mp, India. When Sumit Dhakad and Ajay Patel first started out, theirn passion for pocket-friendly products drove them to start their own business.


			We hope you enjoy our products as much as we enjoy offering them to you. If you have any questions or comments, please don't hesitate to contact us.


			Sincerely,

			Sumit Dhakad and Ajay Patel</p>
		</div>
	)
}

export default AboutUs;
